import "./App.css";
import allCountryScores from "./score";

function App() {
  return (
    <div className="App">
      <h1>High Score Per Country</h1>

      {allCountryScores.map((country, index) => (
        <div key={index}>
          <h1>HIGH SCORES:{country.name}</h1>
          <li>{country.scores.map((element) => element.n + element.s)}</li>
        </div>
      ))}
    </div>
  );
}

export default App;
